import { Link } from "react-router-dom";

function HomePage(props) {
  return (
    <div className="container">
      <div className="box2">
        <h2>Instructions</h2>
        <div>1. There are 10 quetions</div>
        <div>2. 1 min for each quetion </div>
        <div>3. Make sure you have good internet connection </div>
        <button className=".nxtbtn">
          <Link to="/test"> Start Test</Link>
        </button>
      </div>
    </div>
  );
}

export default HomePage;
